import React, { Fragment } from 'react';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import './App.css';
import Homepage from "./components/Homepage";

const App = () => (
  <Router>
    <Fragment>
      <Route exact path="/" component={Homepage} />
    </Fragment>
  </Router>

);

export default App;
